import React, {Component} from "react";
import './App.css';
import Header from "./components/Header/Header";
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/Profile/Profile";
import SecondPost from "./components/SecondPost/SecondPost";
import {BrowserRouter, Routes, Route, Link} from "react-router-dom";


const App = (props) => {

    return (
        <BrowserRouter>
            <div className="app-wrapper">
                <Header/>
                <Navbar/>
                <div className='app-wrapper-content'>
                    <Routes>
                        <Route  path="/secondPost/" element={<SecondPost dialogsData={props.state.dialogsData} messagesData={props.state.messagesData }/>}/>
                        <Route  path="/profile/*" element={<Profile posts={props.state.posts}/>}/>
                    </Routes>
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
